// first and last

import org.apache.spark.sql.functions.{first, last}

df.select(first("StockCode"), last("StockCode"))
  .show()

// min and max

import org.apache.spark.sql.functions.{min, max}

df.select(min("Quantity"), max("Quantity"))
  .show()

// Variance and Standard deviation. Spark has both the formula for the sample standard deviation as well as the formula for the population standard deviation

import org.apache.spark.sql.functions.{var_pop, stddev_pop}
import org.apache.spark.sql.functions.{var_samp, stddev_samp}

df.select(var_pop("Quantity"), var_samp("Quantity"),  stddev_pop("Quantity"), stddev_samp("Quantity"))
  .show()

// skewness and kurtosis. 
// Skewness measures the asymmetry of the values in your data around the mean, whereas kurtosis is a measure of the tail of data. These are both relevant specifically when modeling your data as a probability distribution of a random variable

import org.apache.spark.sql.functions.{skewness, kurtosis}

df.select(skewness("Quantity"), kurtosis("Quantity"))
  .show()

// Covariance and Correlation

//Correlation measures the Pearson correlation coefficient, which is scaled between –1 and +1. The covariance is scaled according to the inputs in the data.Like the var function, covariance can be calculated either as the sample covariance or the population covariance

import org.apache.spark.sql.functions.{corr, covar_pop, covar_samp}

df.select(corr("InvoiceNo", "Quantity"), covar_samp("InvoiceNo", "Quantity"), covar_pop("InvoiceNo", "Quantity"))
  .show()

// Aggregating to Complex TypesIn Spark, you can perform aggregations not just of numerical values using formulas, you can also perform them on complex types. For example, we can collect a list of values present in a given column or only the unique values by collecting to a set
// and perform aggregation on top of that

import org.apache.spark.sql.functions.{collect_set, collect_list}

df.agg(collect_set("Country"), collect_list("Country"))
  .show()

// Grouping with maps

df.groupBy("InvoiceNo").agg("Quantity"->"avg", "Quantity"->"stddev_pop")
  .show()
